import React from 'react';
import '../styles/login.css';

function Logo() {
  return (
    <div className="brand_logo_container">
      <img
        src="logo-recipe-app.png"
        className="brand_logo"
        alt="Logo"
      />
    </div>
  );
}

export default Logo;
